import React from 'react';
import { Container } from 'react-bootstrap';

const About = () => {
  return (
    <Container className="mt-5">
      <h2>About Me</h2>
      <p>
      Hello, my name is Jack Mitchell. I am a second year student at Northeastern University, studying Computer Science with a concentration in software. During my time at the Khoury College of Computer Sciences
       I have been studying a variety of languages, most prominently Java. I have also been a part of the Northeastern Electric Racing Software development team where I, along with a team of over 100 engineers, do web development on the NER website. I am currently focusing on sharpening my C++ skills and am looking to explore any area of software development in the professional world.
      </p>
    </Container>
  );
}

export default About;
